import React from 'react';
import '../global.css';

const navLinks = [
  { label: 'Pricing', href: '#pricing' },
  { label: 'Services', href: '#services' },
  { label: 'Search', href: '#search' },
];

const Navbar = () => {
  return (
    <nav
      style={{
        width: '100%',
        background: '#181818',
        color: '#fff',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 2.5rem',
        height: '72px',
        position: 'fixed',
        top: 0,
        left: 0,
        zIndex: 1000,
        boxShadow: '0 2px 16px 0 rgba(0,0,0,0.08)',
      }}
      className="poppins"
    >
      {/* Logo */}
      <div style={{ display: 'flex', alignItems: 'center', flex: 1 }}>
        <img
          src={require('../assets/logo.png')}
          alt="Logo"
          className="logo"
          style={{
            width: 70, // Increased size
            height: 70,
            marginRight: '1.2rem',
            objectFit: 'contain',
          }}
        />
      </div>

      {/* Centered Nav Links */}
      <div
        style={{
          display: 'flex',
          flex: 2,
          justifyContent: 'center',
          alignItems: 'center',
          gap: '2.5rem',
        }}
      >
        {navLinks.map((link) => (
          <a
            key={link.label}
            href={link.href}
            style={{
              color: '#fff',
              fontWeight: 600,
              fontSize: '1.1rem',
              textDecoration: 'none',
              position: 'relative',
              transition: 'transform 0.2s ease, box-shadow 0.2s ease',
              padding: '0.25rem 0.5rem',
              borderRadius: '0.3rem',
            }}
            className="poppins nav-glow"
          >
            {link.label}
          </a>
        ))}
      </div>

      {/* Login Button */}
      <div style={{ flex: 1, display: 'flex', justifyContent: 'flex-end', paddingRight: '1.5rem' }}>
        {/* Shifted left by reducing right padding */}
        <a
          href="/login"
          style={{
            background: '#4DFF29',
            color: '#181818',
            fontWeight: 700,
            fontSize: '1.1rem',
            border: 'none',
            borderRadius: '0.5rem',
            padding: '0.75rem 2rem',
            cursor: 'pointer',
            textDecoration: 'none',
            boxShadow: '0 4px 0 #37cc1d',
            transition: 'transform 0.2s ease, box-shadow 0.2s ease, background 0.2s',
          }}
          className="poppins nav-glow-3d"
        >
          Login
        </a>
      </div>

      <style>{`
        .nav-glow:hover {
          transform: translateY(-3px);
          box-shadow: 0 4px 12px rgba(77, 255, 41, 0.4), 0 2px 4px rgba(255, 255, 255, 0.2);
          color: #4DFF29 !important;
          background: #232323;
        }

        .nav-glow-3d:hover {
          transform: translateY(-3px);
          box-shadow: 0 6px 14px rgba(77, 255, 41, 0.4), 0 4px 8px rgba(0, 0, 0, 0.2);
          background: #3be622;
        }
      `}</style>
    </nav>
  );
};

export default Navbar;
